import React, { useEffect } from 'react'

import {useParams, Link} from'react-router-dom';

const ViewDetails = () => {

  const {studentid} = useParams;
  useEffect(() => {
    fetch("https://localhost:3400/students/"+studentid).then((res) => res.json()).then((data)=>console.log(data)).catch((err)=>console.log(err.message)
    )

  }, []);


  return (
    <div className='container'>
      <h2>Tələbə Məlumatları</h2>
      <div className='details'>
        <p><strong>ID: </strong>1</p>
        <p><strong>Adı: </strong>123</p>
        <p><strong>Ünvanı: </strong>123</p>
        <p><strong>Mobil nömrəsi: </strong>123</p>
      </div>
      <Link to="/" className='btn btn-back'>Back</Link>
    </div>
  )
}

export default ViewDetails
